import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import LettersList from "./LettersList";

function PhoneticsList() {
  const { REACT_APP_HOST } = process.env;
  return (
    <div className="midde_cont">
      <div className="container-fluid">
        <div className="row column_title page_title">
          <div className="col-6">
            <div className="">
              <h2>Phonetics List</h2>
            </div>
          </div>
          <div className="col-6">
            <button style={{background:'none',border:'none',color:'#15283c'}}>
              <img
                  src="http://localhost:3000/images/icons/plus.png"
                />
              <span style={{paddingLeft:'55px'}}>Add Phonetics</span>
            </button>
          </div>
        </div>
        <div className="row column1">
          <LettersList/>
        </div>
      </div>
    </div>
  );
}
export default PhoneticsList;
